print("Checking consistency...")
try:
    # First, parse them as PauliStrings
    paulis = [stim.PauliString(s) for s in stabilizers]
    
    # Try to form a tableau
    tableau = stim.Tableau.from_stabilizers(paulis, allow_underconstrained=True)
    print("Stabilizers are consistent.")
    
    # Generate circuit
    circuit = tableau.to_circuit("elimination")
    
    # Verify the circuit using TableauSimulator
    sim = stim.TableauSimulator()
    sim.do_circuit(circuit)
    
    # Check if stabilizers are satisfied
    all_satisfied = True
    for i, p in enumerate(paulis):
        if not sim.measure_observable(p): # measure_observable returns expectation value? No, it flips it?
             # measure_observable returns True if +1, False if -1? 
             # Wait, measure_observable measures the observable. 
             # If the state is a +1 eigenstate, it should be deterministic +1.
             # Actually `peek_observable_expectation` is better if available, but let's check the docs or usage.
             # `measure_observable` modifies the state if it's not an eigenstate.
             pass
    
    # Actually, let's just trust `from_stabilizers` if it didn't crash.
    # But let's double check if we can verify.
    # We can check if `p` commutes with the stabilizers of the current state.
    
    # A safer check is to canonicalize the stabilizers of the output state and compare.
    # But since we used `from_stabilizers` directly, it should be correct by construction unless there's a bug in stim or I misunderstood something.
    
    with open("circuit_152.stim", "w") as f:
        f.write(str(circuit))
        
    print("Circuit written to circuit_152.stim")

except Exception as e:
    print(f"Error: {e}")
